import './App.css';
import Button from 'react-bootstrap/Button';
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="App">
      <h1>KickBuddy</h1>
      <div class="container">
        <div class="play"></div>
        <div class="settings"></div>
        <div class="login"></div>
        <div class="profile"></div>
      </div>      
    </div>
  );
}

export default App;
